function resize()
{
	var distance = $(window).width()/2 - dotaLogo.width/2 - (allPoints['_unt9ia5y7'].position.x) + 13;

	$.each(allPoints,function(index,point){

		point.position.x += distance*0.75;
		allPoints_gr[index].position.x += distance;

	});

	$.each(allLines,function(index,linePoints){

		var color = allLines_gr[index].strokeColor;
		var strokeWidth = allLines_gr[index].strokeWidth;

		allLines_gr[index].remove();

		line = new Path();

		line.strokeColor = color;
		line.strokeWidth = strokeWidth;

		line.lineID = index;

		if(allPoints_gr[linePoints.first] != undefined)
			line.add(allPoints_gr[linePoints.first].position);

		if(allPoints_gr[linePoints.second] != undefined)
			line.add(allPoints_gr[linePoints.second].position);

		line.insertBelow(allPoints_gr[linePoints.first]);
		line.insertBelow(allPoints_gr[linePoints.second]);

		allLines_gr[index] = line;

	});

	set_dota_logo_position();
	set_lights(true);
}


function set_dota_logo_position()
{
	dotaLogo.position.x = allPoints_gr['_unt9ia5y7'].position.x - 16;
	dotaLogo.position.y = allPoints_gr['_unt9ia5y7'].position.y - 12;
}

