function init()
{

	if (dotaLogo != undefined && dotaLogo && typeof dotaLogo.remove == 'function')
		dotaLogo.remove();

	dotaLogo = new Raster('dota-logo-img');
	dotaLogo.opacity = 0;
	
	dotaLogo.width = allPoints['_wn070sefs'].position.x - allPoints['_unt9ia5y7'].position.x + 20;
	dotaLogo.height = allPoints['_rsje062wx'].position.y - allPoints['_unt9ia5y7'].position.y + 43;

	dotaLogo.pivot = dotaLogo.bounds.topLeft;

	dotaLogo.bringToFront();

	// add lines and points

	var distance = $(window).width()/2 - dotaLogo.width/2 - (allPoints['_unt9ia5y7'].position.x) + 10;

	$.each(allPoints,function(index,point){

		point.position.x += distance;
		
		var pointData = {
			index: index,
			radius: point.radius,
			dotaPoint: point.dotaPoint
		};

		add_grid_point(point.position,true,pointData);

		allPoints_gr[index].fillColor = '#6D6469';
		allPoints_gr[index].insertAbove(dotaLogo);
	
	});

	set_dota_logo_position();

	var duplicateCheck = [];
	var duplicateIndexes = [];

	$.each(allLines,function(index,linePoints){

		line = new Path();

		var col = primaryColor;

		line.strokeColor = col;

		line.lineID = index;

		if(allPoints_gr[linePoints.first] != undefined)
			line.add(allPoints_gr[linePoints.first].position);

		if(allPoints_gr[linePoints.second] != undefined)
			line.add(allPoints_gr[linePoints.second].position);

		line.insertBelow(allPoints_gr[linePoints.first]);
		line.insertBelow(allPoints_gr[linePoints.second]);

		if(linePoints.dotaLine == true || linePoints.dotaLine == 'true')
			line.insertAbove(dotaLogo);

		allLines_gr.push(line);


	});

	// add lights
	view.scale(0.75);

	topLight = new Raster('top-light');
	rightLight = new Raster('right-light');

	
	set_lights();

	$("#canvas-overlay").css('opacity',0);
	setTimeout(function(){
		$("#canvas-overlay").css('display','none');
	},800);

}

function set_lights(again)
{
	if(again != undefined && again)
	{
		topLight.remove();
		rightLight.remove();

		topLight = new Raster('top-light');
		rightLight = new Raster('right-light');
	}

	topLight.width = view.viewSize.width;
	topLight.height = view.viewSize.height;

	topLight.pivot = topLight.bounds.topLeft;

	topLight.position.x = view.bounds.topLeft.x;
	topLight.position.y = view.bounds.topLeft.y;

	topLight.blendMode = 'luminosity';

	rightLight.width = view.viewSize.width;
	rightLight.height = view.viewSize.height;

	rightLight.pivot = rightLight.bounds.bottomRight;

	rightLight.position.x = view.bounds.bottomRight.x;
	rightLight.position.y = view.bounds.bottomRight.y;

	rightLight.blendMode = 'luminosity';	


	rightLight.opacity = 0.2;
	topLight.opacity = 0.2;
}

