var setInitialPoints = false;

function onFrame(event)
{
	if(setInitialPoints)
	{
		var allPointsInitial = true;

		$.each(allPoints,function(pointID,point){

			var dirX = (allPoints_gr[pointID].position.x - allPoints_gr[pointID].initialPosition.x > 0 ? -1 : 1);
			var dirY = (allPoints_gr[pointID].position.y - allPoints_gr[pointID].initialPosition.y > 0 ? -1 : 1);

			allPoints[pointID].position.x += dirX*2;
			allPoints[pointID].position.y += dirY*2;

			allPoints_gr[pointID].position.x += dirX*2;
			allPoints_gr[pointID].position.y += dirY*2;

			//console.log(Math.abs(allPoints_gr[pointID].position.x - allPoints_gr[pointID].initialPosition.x));

			if(Math.abs(allPoints_gr[pointID].position.x - allPoints_gr[pointID].initialPosition.x) > 4) allPointsInitial = false;
			if(Math.abs(allPoints_gr[pointID].position.y - allPoints_gr[pointID].initialPosition.y) > 4) allPointsInitial = false;

		});

		$.each(allLines,function(index,linePoints){

			allLines_gr[index].remove();

			var line = new Path();
			line.strokeColor = primaryColor;

			line.add(allPoints_gr[linePoints.first].position);
			line.add(allPoints_gr[linePoints.second].position);

			allLines_gr[index] = line;

		});

		//console.log(allPointsInitial);

		if(allPointsInitial) setInitialPoints = false;
	}

	if(animateLogo)
	{
		dotaLogo.opacity += 0.02;

		//console.log(dotaLogo.opacity);
		if(dotaLogo.opacity > 0.4)
		{
			animateLogo = false;
		}
	}
}


function add_grid_point(clientPoint,init,pointData)
{
	var pointSize;
	var dotaPoint;

	if(init) pointSize = pointData.radius;
	else pointSize = parseInt($("#point-size").val());

	if(init) dotaPoint = pointData.dotaPoint;
	else dotaPoint = $("#dota-point").is(":checked");

	var col = primaryColor;

	if(dotaPoint === true || dotaPoint == 'true')
	{
		col = '#DA2C35';
	}

	var gridPoint = new Path.Circle({
		center: clientPoint,
		radius: pointSize,
		fillColor: col, // #6D6469
		strokeWidth: 0,
	});

	gridPoint.pointSize = pointSize;
	gridPoint.dotaPoint = dotaPoint

	gridPoint.initialPosition = {}
	gridPoint.initialPosition.x = gridPoint.position.x;
	gridPoint.initialPosition.y = gridPoint.position.y;	

	var pointID;

	if(!init)
		var pointID = uniqid();
	else
		pointID = pointData.index;

	if(!init)
	{
		allPoints[pointID] = {};
		allPoints[pointID].dotaPoint = dotaPoint;
		allPoints[pointID].radius = pointSize;
		allPoints[pointID].position = clientPoint;
	}

	gridPoint.pointID = pointID;
	allPoints_gr[pointID] = gridPoint;

	if(allPoints[pointID].dotaPoint === true)
		allPoints_gr[pointID].fillColor = '#6D6469';

}


function info(type,message)
{
	var colors = {'error': 'crimson', 'warning': 'orange', 'ok': 'green'};

	$info_span = $('<span class="info">'+message+'</span>');

	$info_span.css({
		'position': 'fixed',
		'top': '10px',
		'right': '10px',
		'z-index': '100000',
		'font-size': '1.5em',
		'font-family': 'Monospace',
		'font-weight': 'bold',
		'color': colors[type]
	});

	$(document.body).append($info_span);

	setTimeout(function(){
		$info_span.remove();
	},2000);
}

function uniqid()
{
	return '_' + Math.random().toString(36).substr(2, 9);
}


function clearView()
{
	$.each(allPoints_gr,function(index,elem){ elem.remove(); });
	$.each(allLines_gr,function(index,elem){ elem.remove(); });
}

function redrawView()
{
	init();
	start();
}

function setBackground()
{
	if(background != undefined && typeof background.remove == 'function') background.remove();
 
	background = new Path.Rectangle({
	    point: [view.bounds.topLeft.x,view.bounds.topLeft.y],
	    size: [view.size.width, view.size.height],
	    strokeWidth: 0,
	    fillColor: '#574E53'
	});

	background.sendToBack();
}

function animate_points()
{
	animationPlaying = true;
	var dotaPoints = [];

	$.each(allPoints,function(pointID,point){

		if(pointID.dotaPoint == true || point.dotaPoint == 'true')
			dotaPoints.push(pointID);

	});

	//console.log(dotaPoints);

	shuffle(dotaPoints);

	var i = 0;

	var pointAnimInterval = setInterval(function(){

		//console.log(i + ' - ' + dotaPoints[i]);
		if(i == dotaPoints.length)
		{
			clearInterval(pointAnimInterval);
			animate_lines();
			return;
		}

		allPoints_gr[dotaPoints[i]].fillColor = '#DA2C35';
		++i;

	},8);
}

function animate_lines()
{
	//console.log("ANIMATE LINES");

	var dotaLines = [];

	$.each(allLines_gr,function(index,line){

		if(allLines[index].dotaLine == true || allLines[index].dotaLine == 'true')
			dotaLines.push(line);

	});

	//console.log(dotaLines);

	shuffle(dotaLines);

	var i = 0;

	var lineAnimInterval = setInterval(function(){

		var end = false;

		if(i < dotaLines.length)
		{
			dotaLines[i].strokeColor = '#DA2C35';
			dotaLines[i].strokeWidth = 2;
		}
		else end = true;

		if(i+1 < dotaLines.length)
		{
			dotaLines[i+1].strokeColor = '#DA2C35';
			dotaLines[i+1].strokeWidth = 2;
		}
		else end = true;

		if(i+2 < dotaLines.length)
		{
			dotaLines[i+2].strokeColor = '#DA2C35';
			dotaLines[i+2].strokeWidth = 2;
		}
		else end = true;

		

		if(end)
		{
			clearInterval(lineAnimInterval);

			animate_logo();

			return;
		}

		
		i += 3;

	},30);
}

var animateLogo = false;

function animate_logo()
{
	animateLogo = true;
	animationPlaying = false;
	animationFinished = true;
}

function shuffle(array) {
  var currentIndex = array.length, temporaryValue, randomIndex;

  while (0 !== currentIndex) {

    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex -= 1;

    temporaryValue = array[currentIndex];
    array[currentIndex] = array[randomIndex];
    array[randomIndex] = temporaryValue;
  }

  return array;
}


